/// <reference types="cypress"/>

context('gera pdf test', () => {
    let token;

    it('Loga o usuario', () => {
        cy.request({
            method: 'POST',
            url: "/autenticacao/login",
            headers: {
                'Content-Type': 'application/json'
            },
            body: { 
                email: "thauan.amorim@academico.ifpb.edu.br", 
                senha: "123456", 
            },
            log: true ,
            failOnStatusCode: false
        }).then((response) => {
            expect(response.status).to.equal(200)
            token = response.body.data.token
        })
    });

    it('gerapdf com sucesso', () => {
        cy.request({
            method: 'POST',
            url: "/gerador_pdf",
            headers: {
                'Content-Type': 'application/json',
                "Authorization": "Bearer " + token
            },
            body: {
                subPartes: [
                    {
                        conteudo: "olá",
                        tituloConteudo: "Titulo",
                        tipo: "TEXTO"
                    },
                    {
                        "conteudo": "Conta-se que por volta do ano 250 A.C, na China antiga, um príncipe da região norte do país, estava às vésperas de ser coroado imperador, mas, de acordo com a lei, ele deveria se casar. Sabendo disso, ele resolveu fazer uma “disputa” entre as moças da corte ou quem quer que se achasse digna de sua proposta.No dia seguinte, o príncipe anunciou que receberia, numa celebração especial, todas as pretendentes e lançaria um desafio. Uma velha senhora, serva do palácio há muitos anos, ouvindo os comentários sobre os preparativos, sentiu uma leve tristeza, pois sabia que sua jovem filha nutria um sentimento de profundo amor pelo príncipe.Ao chegar em casa e relatar o fato a jovem, espantou-se ao saber que ela pretendia ir à celebração, e indagou incrédula:– Minha filha, o que você fará lá? Estarão presentes todas as mais belas e ricas moças da corte. Tire esta ideia insensata da cabeça; eu sei que você deve estar sofrendo, mas não torne o sofrimento uma loucura.",
                        "tipo": "TEXTO"
                    },
                    {
                        "conteudo": "data:image/png;base64,",
                        "tituloConteudo": "Imagem",
                        "tipo": "IMAGEM"
                    }
                ]
            },
            log: true,
            failOnStatusCode: false
        }).then(function(response){
            expect(response.status).to.equal(200)
            expect(response.body.data.conteudo).to.not.be.empty
        })
    });
});